import React from 'react';
import './styles.css'

export default class ExperienceBox extends React.Component {
    render() {
        return (
            <div >
                <h3 id="expTitle">{this.props.title}</h3>
                <h6 id="expDate">{this.props.date}</h6>
                <div>
                    <h4 id="expPrimTitle">{this.props.primaryRoleTitle}</h4>
                    <p id="expPrim">{this.props.primaryRole}</p>
                </div>
                {this.props.secondaryRole && this.props.secondaryRoleTitle ? 
                (
                <div>
                    <h4 id="expSecTitle">{this.props.secondaryRoleTitle}</h4>
                    <p id="expSec">{this.props.secondaryRole}</p>
                </div>
                ) : null}
                <p id="expDesc">{this.props.description}</p>
            </div>
        )
    }
}
